import React, { Component } from "react";
import Like from "./Like";
import TableTitle from "./tableTitle";
class CartTable extends Component {
  state = {
    sortColumn: {},
  };
  column = [
    { lable: "name", path: "title" },
    { lable: "quantity", path: "genre.name" },
    { lable: "Stok", path: "numberInStock" },
    { lable: "Rate", path: "dailyRentalRate" },
    {
      key: "like",
      content: (movie) => (
        <Like liked={movie.liked} onLike={() => this.props.onLike(movie)} />
      ),
    },
    {
      key: "delete",
      content: (movie) => (
        <button
          className="btn btn-danger m-2 btn-sm"
          onClick={() => this.props.onDelete(movie)}
        >
          Delete
        </button>
      ),
    },
  ];

  handleSort = (sortColumn) => {
    this.setState({ sortColumn });
    console.log(this.state.sortColumn);
  };
  render() {
    return (
      <table className="cartTable-table">
        <TableTitle
          column={this.column}
          onSort={this.handleSort}
          sortColumn={this.state.sortColumn}
        />
        <tbody>
          <tr className="cartTable-row">
            <td>
              <img src="/img/item-1.png" width={80} />
            </td>
            <td>t-shirt</td>
            <td>01</td>
            <td>76$</td>
          </tr>
          <tr className="cartTable-row">
            <td>
              <img src="/img/item-1.png" width={80} />
            </td>
            <td>t-shirt</td>
            <td>01</td>
            <td>76$</td>
          </tr>
          <tr className="cartTable-row">
            <td>
              <img src="/img/item-1.png" width={80} />
            </td>
            <td>t-shirt</td>
            <td>01</td>
            <td>76$</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default CartTable;
